import { useState } from "react"

const Image = () => {
    const [img, setImg] = useState()
    return(
        <>
        <div>
            <input className="image" type="text" placeholder="img url" onInput={(event) => setImg(event.target.value)}/>
            
        </div>
        <img src={img} alt="" className="img"/>
        </>
    )
}

export default Image;
